Up for sale is a Mossberg Maverick 88 (500) 12 gauge pump shotgun. Holds 5 in the magazine tube and 1 in the chamber. comes with a 30 inch barrel fixed full choke. Gun is in good shape overall. Barrel has been painted black. Not sure why...just how I bought it and haven't bothered removing the paint. A good utility "truck gun" or HD weapon.

$160 FTF in North Raleigh or Wake Forest only. Must have a valid NCDL and be willing to sign a basic bill of sale. No Exceptions
